import React, { Component } from 'react';
import Footer from '../include/footer';
import NextFooter from '../include/next_footer';

class Mail extends Component{
    render(){
        return(
            <div>
                <section className="mail-f"></section>
                <NextFooter/>
                <Footer/>
            </div>
        )
    }
}

export default Mail;
